    false,nt"url": null,nt"notes": "Available information on black bear denning
    ecology in southeastern wetland populations for management and conservation purposes
    is limited. This researcher investigated black bear den characteristics and denning
    chronology in the Great Dismal Swamp of Virginia and North Carolina. Thirty-five
    bears (26 female, 9 male) were radio monitored throughout the winters of 1984-85,
    1985-86, and 1986-87. This report describes the results of that work.",nt"license_title":
